// structs/FoodTypes.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

enum Role {
    None,
    Admin,
    RestaurantOwner,
    Staff,
    Customer
}

enum OrderStatus {
    Placed,
    Cancelled,
    Confirmed,
    Preparing,
    ReadyForPickup,
    OutForDelivery,
    Delivered,
    Completed
}

// Thông tin chi tiết của một nhà hàng
struct Restaurant {
    uint128 id;
    string name;
    address owner;
    string location;
    string imageUrl;
    bool isActive;
    uint256 registrationTimestamp;
    uint256 totalRatingSum; // Tổng điểm đánh giá cho nhà hàng
    uint256 ratingCount;    // Số lượt đánh giá cho nhà hàng
}

struct MenuItem {
    uint128 id;
    uint128 restaurantId;
    string name;
    string description;
    string category;
    uint128 price;
    string imageUrl;
    string videoUrl;
    bool available;
    uint128 preparationTime;
    uint256 totalRatingSum; // Tổng điểm đánh giá cho món ăn
    uint256 ratingCount;    // Số lượt đánh giá cho món ăn
}

// Chi tiết một món trong một đơn hàng cụ thể
struct OrderItemDetail {
    uint128 menuItemId;
    string itemName;
    uint128 quantity;
    uint128 priceAtOrder;
    uint128 itemTotalPrice;
}

struct Order {
    uint128 id;
    address customerAddress;
    uint128 restaurantId;
    // Chi tiết các món sẽ được lưu ở mapping riêng: mapping(uint128 => OrderItemDetail[]) trong FoodApp.sol
    uint128 totalPrice;
    uint256 serviceFee;
    uint256 finalAmountPaid;
    OrderStatus status;
    uint256 placedTimestamp;
    uint256 lastUpdateTimestamp;
    uint128 estimatedPreparationTime;
    address staffAssigned; 
    string deliveryAddress;
    string notes;
}

// Đánh giá cho NHÀ HÀNG
struct RestaurantReview {
    uint128 id;                 
    address customerAddress;    
    uint128 restaurantId;       
    uint8 rating;               
    string comment;
    uint256 reviewTimestamp;
}

// Đánh giá cho MÓN ĂN
struct MenuItemReview {
    uint128 id;                 
    address customerAddress;    
    uint128 menuItemId;         
    uint128 restaurantId;       
    uint8 rating;              
    string comment;
    uint256 reviewTimestamp;
}

// Đánh giá cho NHÂN VIÊN
struct StaffReview {
    uint128 id;                 
    address customerAddress;    
    address staffAddress;       
    uint128 restaurantId;       
    uint128 orderId;            
    uint8 rating;               
    string comment;
    uint256 reviewTimestamp;
}

